import { Avatar, Card } from "antd";
import React from "react";

function UserProfile() {
  return (
    <Card
      actions={[
        <div key="twit">
          트윗
          <br />0
        </div>,
        <div key="followings">
          팔로잉
          <br />0
        </div>,
        <div key="followings">
          팔로우
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>GG</Avatar>} title="GGyu" />
    </Card>
  );
}

export default UserProfile;
